script: |
  super -f text -I q695.spq | sort > q695.out

inputs:
  - name: q695.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT + col1 NOT BETWEEN + + 96 * - col2 + + col0 AND + + 48 + col1;
  - name: tab0

outputs:
  - name: q695.out
    data: |
      15	81	47
      87	21	10
      97	1	99
